import React, { Component } from 'react';

export default class Miner extends Component {

  render() {

    const {onClick} = this.props

    return (
      <div id="divMiner" onClick={onClick}>
        <img id="close" draggable="false" src={require("../images/cancel.png")}/>
        <img id="pioche" draggable="false" src={require("../images/pickaxe.png")}/>
        <img id="coin" draggable="false" src={require("../images/coin.png")}/>
        <img id="eclats" draggable="false" src={require("../images/eclats.png")}/>
      </div>
    );
  }
}
